// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;


interface Insep {
    function getString() external view returns (string memory);
    function set_string(string memory _string) external;
    function setAddress(address _address_nsdp) external;
}

contract nsdp {
    struct Entity {
        uint256 id;
        bytes32 name;
        uint256 trust_value;
        //other stuff;
        bool set;
    }
    uint256 public counter = 0;

    mapping(address => Entity) public entities;

    function create_new_entity(address _entity_address, uint256 _trust_value) public {
        //check if the entity is already created
        Entity storage entity_pointer = entities[_entity_address]; //need storage to create a pointer
        require(!entity_pointer.set, "user is already added");
        //store the data
        entities[_entity_address] = Entity({
            id: ++counter,
            name: "someone",
            trust_value: _trust_value,
            set: true
        });
    }

    address address_nsep;
    string data;
    constructor(address _address_nsep) {
        address_nsep = _address_nsep;
        data = "hello world 2";
        Insep(address_nsep).setAddress(address(this));
    }

    function call_getstring() external view returns(string memory) {
        // nsep pointer = nsep(address_nsep);
        return Insep(address_nsep).getString();
    }
    function call_setsting(string memory _string) external {
        Insep(address_nsep).set_string(_string);
    }
    function getString() public view returns(string memory) {
        return data;
    }
}
